        if(pshop!=null) {
            // Remove price items
            BindingItem newBi = new BindingItem(RingTableItem.getRingTypeForPresentationString(rti.getRingType()), rti.getInfLim(), rti.getSupLim());
            pshop.getPriceTable().remove(newBi.genKey());
